import ReactDOM from "react-dom";
import App from "./components/App";
import { Router } from "react-router-dom"

import "./styles.css";

const rootElement = document.getElementById("root");
ReactDOM.render(
  <Router>
    <App />
  </Router>,
  rootElement
);
